  import React, { useState, useEffect } from 'react';
  import { BrowserRouter, Routes, Route } from 'react-router-dom';
  import Navbar from './Navbar';
  import Home from './Home';
  import About from './About';
  import Contact from './Contact';
  import Team from './Team';
  import Error from './Error';
  import Signup from './Signup';
  import Login from './Login';
  import SimpleSlider from './SimpleSlider';
  import ScrollButton from './ScrollButton';
  import Loading from './Loading';
  import Logos from './Logos';
import ForgotPassword from './ForgotPassword';
import FlightBookingPage from './FlightBookingPage';

  const App = () => {
    const [loading, setLoading] = useState(false);


    const handleRouteChange = () => {
      setLoading(true);
      setTimeout(() => setLoading(false), 1000);
      console.log("handleRouteChange function executed");
    };

    return (
      <div>
        {loading ? (
          <Loading />
        ) : (
          <BrowserRouter>
            <Navbar abc={"yes"} handleRouteChange = {handleRouteChange}/>
            <ScrollButton />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/about" element={<About />} />
              <Route path="/contact" element={<Contact />} />
              <Route path="/about/team" element={<Team />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/error" element={<Error />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Signup />} />
              <Route path="/forgot" element={<ForgotPassword />} />
              <Route path="/flightbooking" element={<FlightBookingPage />} />
              <Route path="*" element={<Error />} />
              {/* <Route path="/slider" element={<SimpleSlider />} /> */}
              {/* <Route path="/logos" element={<Logos />} /> */}
            </Routes>
          </BrowserRouter>
        )}
      </div>
    );
  };

  export default App;
